import React,{ Component } from 'react';
import logo from './logo.svg';
import './App.css';
import { tsConstructorType } from '@babel/types';

class App extends Component{
  constructor() {
    super();
    this.state = {
     monsters: [
       {
         name : 'Satish'
       },
       {
        name : 'Sonu'
      },
      {
        name : 'Shreyansh'
      },
      {
        name : 'Ashok'
      },
      {
        name : 'Vani'
      }
     ]
    }
  }
  render(){



    return (

          <div className="App">
            <header className="App-header">
              <img src={logo} className="App-logo" alt="logo" />
              <p>
              {this.state.string}
              </p>
            <button onClick={()=>this.setState({string:'Hello Sai'})}>Click</button>
              <a
                className="App-link"
                href="https://reactjs.org"
                target="_blank"
                rel="noopener noreferrer"
              >
                Learn React
              </a>
            </header>
          </div>
        );
      }

}

export default App;
